import "./Error.css";
import { NavLink } from 'react-router-dom';
import ErrorPic from '../assets/ErrorPic.png';
import Button from '@mui/material/Button';

// var sectionStyle ={
//     width: "100%",
//     height: "400px",
//     backgroundImage: "url(" + { ErrorPic } + ")"
// };

const Error = () => {
    return (
        <div style={{ backgroundImage: `url(${ErrorPic})`,
        backgroundSize:'cover',
         width: '100%', 
         height: '800px',
         display:'flex',
         justifyContent:'center',
         alignItems:'center' }}>
            < ><Button color ='primary' style = {{textTransform:'none', color:'secondary'}}>Go Home</Button></>
        </div>);
}
export default Error;
